import React from 'react';

const Item = (props) => {
    
    if (!props.myArray) {
        return <div>Loading...</div>;
      }
   

    return (
        <div>
           <div>
           <ul>
        {props.myArray.map((item) => (
          <li key={item}>{item + 10}</li>
        ))}
      </ul>
    
      
           </div>
        </div>
    );
};

export default Item;
